    gettextCatalog.setStrings('nb', {"About":"Om","Active subject":"Valgt emneord","All branches":"Alle avdelinger","All libraries":"Alle bibliotek","An unknown error occured.":"Det oppsto en ukjent feil.","Broad":"Bredt","broad search":"bredt søk","Catalogue results":"Katalogresultater","Containing":"Inneholder","Ends with":"Slutter med","Enter a subject":"Søk etter emne","Exact match":"Eksakt lik","Failed to fetch list of editions.":"Klarte ikke hente utgaver.","Fetching more editions…":"Henter flere utgaver…","For information about the subject vocabularies, see the <a ui-sref=\"home\">start page</a>.":"For informasjon om emnevokabularene, se <a ui-sref=\"home\">startsiden</a>.","Found one document about this topic using {{vm.searchType}}, querying for ‘{{vm.searchQuery}}’":["Fant ett dokument om dette emnet med {{vm.searchType}}. Spurte etter ‘{{vm.searchQuery}}’.","Fant {{vm.total_results}} dokumenter om dette emnet med {{vm.searchType}}. Spurte etter ‘{{vm.searchQuery}}’."],"GenreForm":"Sjanger/form","Geographic":"Sted","Grunnstoff":"Chemical element","How odd! Not a single document on that subject could be found using the current subject vocabulary.":"Så rart! Ikke et eneste dokument ble funnet ","Human rights":"Menneskerettigheter","Humanities and social sciences":"Humaniora og samfunnsfag","Humord is the best portal to the humanities and social sciences. The vocabulary also has a relatively large amount of interdisciplinary subject headings. This vocabulary has only Norwegian Bokmål terms.":"Humord gir den beste inngangen til humaniora og samfunnsfag. Vokabularet har også en stor mengde tverrfaglige termer. Dette vokabularet har bare emneord på bokmål.","Loaded {{ vm.last }} records so far, {{ vm.total_results - vm.last }} to go, hold on…":"{{ vm.last }} poster hentet så langt, {{ vm.total_results - vm.last }} gjenstår, vi skynder oss sakte…","Looking…":"Leter…","More editions":"Flere utgaver","Narrow":"Snevert","narrow search":"snevert søk","No hits :(":"Ingen treff :(","No network connection":"Ingen nettverksforbindelse","Note: Results from a single branch will not include e-books.":"Merk: E-bøker inkluderes ikke når man avgrenser til én enkelt avdeling.","Note: Search for subject strings is currently experimental, and might not yet work as expected.":"Merk: Søk etter emnestrenger er på eksperimentstadiet og funker kanskje ikke helt som forventa.","Once in, you can toggle between <em>broad</em> and <em>narrow</em> search. With <em>narrow</em> search, you will only get highly relevant results carefully indexed by skilled librarians and subject specialists using the selected vocabulary. <em>Broad</em> search will give you more results, matching subjects from other vocabularies or even keywords from a variety of sources, but sometimes at the expense of precision.":"Vel inne kan du velge mellom <em>bredt</em> og <em>snevert</em> søk. Med <em>snevert</em> søk vil du kun få relevante resultater som har blitt møysommelig indeksert av flinke bibliotekarer og fagfolk ved hjelp av det valgte vokabularet. <em>Bredt</em> søk er ikke like presist, men vil gi flere resultater ved at det også søkes mot andre vokabularer og frie nøkkelord fra en rekke kilder.","One edition:":["Én utgave:","{{$count}} utgaver:"],"Print copy at":"Trykt utgave ved","Science":"Realfag","Search '+vm.vocab+' only":"Søk kun i '+vm.vocab+'","Search all subject vocabularies":"Søk i alle vokabularer","Search for scientific concepts. <em>Realfagstermer</em> is a controlled vocabulary maintained by the science libraries at the University at Oslo and Bergen, and is the best portal to our collections. Realfagstermer is a multilingual vocabulary that can be searched in Bokmål, Nynorsk (translation in progress), English (translation in progress) and Latin (scientific names).":"Søk etter realfaglige begreper. <em>Realfagstermer</em> er et kontrollert begrep som vedlikeholdes av realfagsbibliotekene ved UiO og UiB, og gir den beste inngangen til disse samlingene. Realfagstermer er et flerspråklig vokabular der du kan søke på både bokmål, nynorsk (oversettelse i arbeid), engelsk (oversettelse i arbeid) og latin (vitenskapelige navn).","Search history":"Søkehistorie","See also:":"Se også:","Series":"Serie","Several fantastic pieces of free and open-source software have been used to build this search. A list is provided below together with their licenses.":"En rekke supre åpen kilde-komponenter er brukt for å bygge emnesøket. De er listet opp under sammen med lisensene de er underlagt.","Sorry, the subject \"{{subject}}\" was not found in the current vocabulary.":"Beklager, emnet «{{subject}}» ble ikke funnet i dette vokabularet.","Starting with":"Begynner med","Subject Search":"Emnesøk","Subject Search ß":"Emnesøk ß","Technology and engineering":"Teknologi og ingeniørfag","Tekord is a vocabulary created at NTNU (Norwegian University of Science and Technology). It is an especially useful search portal to Technical and Engeneering literature. This vocabulary has only Norwegian Bokmål terms.":"Tekord er et vokabular utviklet ved NTNU. Det er særlig en god søkeinngang til teknisk faglitteratur ved NTNU. Dette vokabularet har bare norske emneord.","Temporal":"Tid","The search went out in error:":"Søket gikk ut i feil","The Subject Search is <a href=\"https://github.com/scriptotek/emnesok\">open source</a> and licensed under the <a href=\"https://github.com/scriptotek/emnesok/blob/master/LICENSE\">MIT license</a>.":"Emnesøket er <a href=\"https://github.com/scriptotek/emnesok\">åpen kildekode</a> lisensisert under <a href=\"https://github.com/scriptotek/emnesok/blob/master/LICENSE\">MIT-lisensen</a>.","The Subject Search is developed by the University of Oslo Science Library. Vocabulary search and retrieval is powered by a <a href=\"http://skosmos.org/\">Skosmos</a> instance using data from <a href=\"http://data.ub.uio.no\">data.ub.uio.no</a>, while library catalogue search and retrieval is powered by <a href=\"https://developers.exlibrisgroup.com/primo/apis/webservices/xservices/search/briefsearch\">Primo</a> through a locally developed middleware (<a href=\"https://github.com/scriptotek/scs\">SCS</a>).":"Emnesøket er utviklet av UiO Realfagsbiblioteket. Søk i emnevokabularer drives av en <a href=\"http://skosmos.org/\">Skosmos</a>-instans med data fra <a href=\"http://data.ub.uio.no\">data.ub.uio.no</a>, mens søk i bibliotekskatalogen drives av <a href=\"https://developers.exlibrisgroup.com/primo/apis/webservices/xservices/search/briefsearch\">Primo</a> via en lokalt utviklet mellomvare (<a href=\"https://github.com/scriptotek/scs\">SCS</a>).","The subject was not found. It might have been deleted.":"Emnet ble ikke funnet. Det kan ha blitt slettet.","Third party licenses":"Tredjepartslisenser","Topic":"Emne","Uh oh, some kind of server error occured.":"Det oppsto en serverfeil, vi beklager.","Used for:":"Brukt for:","Welcome to our subject search. Start by choosing a vocabulary from the list below. A vocabulary is a controlled set of subjects. Searching all vocabularies at the same time isn't yet supported, but definitely something we would like to support in the future.":"Velkommen til emnesøket vårt. Begynn med å velge et emne-vokabular fra listen under. Et emne-vokabular er et kontrollert sett av emneord. Søk i alle vokabularer samtidig er ikke støttet enda, men det er funksjonalitet vi håper å få lagt til i fremtiden.","Welcome to the new Subject Search beta. Head over <a href=\"https://github.com/scriptotek/emnesok/issues\">to GitHub</a> if you want to peek into the current state of development, report a problem or suggest an idea. If you're looking for the old Subject Search, it's <a href=\"http://app.uio.no/ub/emnesok/test/oria/\">still around</a>.":"Velkommen til beta-utgaven av det nye emnesøket. Du kan følge med på utviklingen <a href=\"https://github.com/scriptotek/emnesok/issues\">på GitHub</a>, og der kan du også melde fra om feil og foreslå forbedringer. Hvis du savner det gamle emnesøket, finner du det <a href=\"http://app.uio.no/ub/emnesok/test/oria/\">her</a>.","Yes, we have a controlled subject vocabulary just for human rights terms! Developed and maintained by the Norwegian Centre for Human Rights’ (SMR), the vocabulary has only English terms.":"Ja, vi har et eget emne-vokabular bare for menneskerettighetsterminologi! Det utvikles og vedlikeholdes av biblioteket ved Norsk senter for menneskerettigheter (SMR) og har bare termer på engelsk.","You could try expanding the search to a <a ui-sref=\"subject.search({narrow:false})\">broad search</a>.":"Prøv gjerne å utvide søket til et <a ui-sref=\"subject.search({narrow:false})\">bredt søk</a>.","You've reached the end, my friend!":"Du har nådd enden av lista."});
